import { useState } from "react"

export default function Photo() {
    let [count, setCount] = useState(0); 
    return (
        <>
        <div>{count}</div>
      <button className="increment" onClick={setCount(count+1)}>Увеличить</button>
      <button className="decrement" onClick={setCount(count-1)}>Уменьшить</button>
      </>
    )
}
